import React from 'react';
import s from "./Transport.module.css";
import Category from "../Category/Category";
import Subcategories from "../Subcategories/Subcategories";

import archirect from './../architect.svg';
import auto from './../auto.svg';
import moto from './../moto.svg';
import household from './../household.svg';

import {
  MAIN_PAGE,
  TRANSPORT, IMMOVABLES, HOUSEHOLD,
  APPARTAMENTS, HOUSES,
  CARS, MOTO,
  APPLIANCE, FURNITURE, setLocationName
} from "../../redux/UrlReducer";

const Transport = (props) => {
  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Category nameCategory={IMMOVABLES.name} imgPath={archirect} urlCategory={IMMOVABLES.url}/>
            <Subcategories nameSubCat={CARS.name} imgPath={auto} urlCategory={TRANSPORT.url} urlSubcategory={CARS.url}/>
            <Subcategories nameSubCat={MOTO.name} imgPath={moto} urlCategory={TRANSPORT.url} urlSubcategory={MOTO.url}/>
            <Category nameCategory={HOUSEHOLD.name} imgPath={household} urlCategory={HOUSEHOLD.name}/>
          </div>
        </div>
      </div>
  );
};

export default Transport;
